DROP TABLE IF EXISTS `alumno`;
CREATE TABLE `alumno` (
  `serial_alu` int(11) NOT NULL auto_increment,
  `serial_nac` int(11) default NULL,
  `serial_col` int(11) default NULL,
  `serial_sex` int(11) default NULL,
  `serial_tra` int(11) default NULL,
  `serial_can` int(11) default NULL,
  `serial_pai` int(11) default NULL,
  `nombre_alu` char(30) character set latin1 collate latin1_spanish_ci NOT NULL default '',
  `apellido_alu` char(40) character set latin1 collate latin1_spanish_ci NOT NULL default '',
  `tipoIdentificacion_alu` char(1) character set latin1 collate latin1_spanish_ci default NULL,
  `codigoIdentificacion_alu` char(50) character set latin1 collate latin1_spanish_ci default NULL,
  `fecnac_alu` date default NULL,
  `direcc_alu` char(80) character set latin1 collate latin1_spanish_ci default NULL,
  `mail_alu` char(50) character set latin1 collate latin1_spanish_ci default NULL,
  `telefo_alu` char(50) character set latin1 collate latin1_spanish_ci default NULL,
  `busRetorno_alu` int(11) default NULL,
  `conQuienVive_alu` char(1) character set latin1 collate latin1_spanish_ci default NULL,
  `fechaIngreso_alu` date default NULL,
  `observacion_alu` char(255) character set latin1 collate latin1_spanish_ci default NULL,
  `fechaObs_alu` date default NULL,
  `foto_alu` char(255) character set latin1 collate latin1_spanish_ci default NULL,
  `estado_alu` char(1) character set latin1 collate latin1_spanish_ci default NULL,
  `paseObs_alu` char(255) character set latin1 collate latin1_spanish_ci default NULL,
  `cursoAprobado_alu` char(50) character set latin1 collate latin1_spanish_ci default NULL,
  `seccionAprobado_alu` char(50) character set latin1 collate latin1_spanish_ci default NULL,
  `id_alumno` char(15) character set latin1 collate latin1_spanish_ci NOT NULL default '',
  PRIMARY KEY  (`serial_alu`),
  KEY `codigoIdentificacion_alu_idx` (`codigoIdentificacion_alu`)
) ENGINE=InnoDB DEFAULT CHARSET=latin1 COLLATE=latin1_bin;

